import React from "react";
export default function Input({ value, setRate, placeholderValue }) {
    return (
        <>
            <input
                className="input"
                placeholder={placeholderValue}
                value={value}
                onChange={(e) => setRate(e.target.value)}
            />
        </>
    )
}
